        <h1 className='yugitoken'></h1>
        <div class="abc">
            <div className="heading white-heading">WHAT PEOPLE ARE SAYING</div>
            <p>
                The first-ever create-to-earn NFT
                game in the history of blockchain
                technology, Yugi: Clash of
                Pantheons.  Pantheons.  Pantheons.  Pantheons.  Pantheons.
            </p>
        </div>
        <PieChart />
        <Footer />
    </>;
}
